window.bookSummaryJSON = "<i>A killer with no face, no identity, and a name the world wanted to forget: Jason Bourne....</i> <p>Reenter the shadowy world of Jason Bourne, an expert assassin still plagued by the splintered nightmares of his former life. This time the stakes are higher than ever. For someone else has taken on the Bourne identity, a ruthless killer who must be stopped or the world will pay a devastating price.</p> <p>To succeed, the real Jason Bourne must maneuver through the dangerous labyrinth of international espionage, an exotic world filled with CIA plots, turncoat agents, and ever-shifting alliances, all the while hoping to find the truth behind his haunted memories and the answers to his own fragmented past. This time there are two Bournes...and one must die.</p>"; 
